import React, { useEffect } from "react";
import Phaser from "phaser";

// TODO: Fix audio playback and GIF overlay for key '6' press
// - Audio from /for_AI_chat/roblox-death-sound_1.mp3 not playing
// - GIF overlay not showing
// - Key '7' (rickroll) restored and working
// - Key '6' functionality still needs fixing

const PhaserGame = () => {
  useEffect(() => {
    const config = {
      type: Phaser.AUTO,
      width: 800,
      height: 600,
      parent: "phaser-container",
      physics: {
        default: "arcade",
        arcade: { gravity: { y: 300 }, debug: false },
      },
      scene: { preload, create, update },
    };

    let game = new Phaser.Game(config);

    let player,
      cursors,
      platforms,
      score = 0,
      scoreText,
      stuck = false,
      pipeAudio = null,
      oofAudio = null,
      jumpscareAudio = null,
      // TODO: replace with your actual data URL for the jumpscare audio
      jumpscareDataUrl = "data:audio/mpeg;base64,",
      lastGroundContact = false,
      keySix,
      keySeven,
      keyW,
      keyA,
      keyS,
      keyD,  // Add WASD keys
      overlayContainer = null,
      currentOverlay = null;

    function preload() {
      this.load.image(
        "platform",
        "https://labs.phaser.io/assets/sprites/platform.png"
      );
      this.load.image(
        "player",
        "https://labs.phaser.io/assets/sprites/phaser-dude.png"
      );
      this.load.image(
        "coin",
        "https://labs.phaser.io/assets/sprites/yellow_ball.png"
      );
      // Remove Phaser audio loads
    }

    function create() {
      platforms = this.physics.add.staticGroup();
      platforms.create(400, 580, "platform").setScale(2).refreshBody();

      player = this.physics.add.sprite(100, 450, "player");
      // exaggerated slippery physics: small drag, high accel and high top speed for a very "slippery" feel
      player.setBounce(0.12);
      player.setCollideWorldBounds(true);
      const SLIP = { ACCEL: 1500, MAX_VEL: 600, DRAG_X: 10, JUMP_V: -520 };
      player.setMaxVelocity(SLIP.MAX_VEL, 1000);
      player.setDrag(SLIP.DRAG_X, 0);

      this.physics.add.collider(player, platforms);

      cursors = this.input.keyboard.createCursorKeys();

      // Add keys 6 and 7 (troll inputs)
      keySix = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.SIX);
      keySeven = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.SEVEN);

      // Add WASD keys
      keyW = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.W);
      keyA = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.A);
      keyS = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.S);
      keyD = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.D);

      // Initialize overlay container
      const parentEl = document.getElementById("phaser-container");
      overlayContainer = document.createElement("div");
      overlayContainer.style.position = "absolute";
      overlayContainer.style.left = "0";
      overlayContainer.style.top = "0";
      overlayContainer.style.width = "100%";
      overlayContainer.style.height = "100%";
      overlayContainer.style.display = "flex";
      overlayContainer.style.alignItems = "center";
      overlayContainer.style.justifyContent = "center";
      overlayContainer.style.pointerEvents = "none";
      overlayContainer.style.zIndex = "1000";
      parentEl.style.position = parentEl.style.position || "relative";
      parentEl.appendChild(overlayContainer);

      // Initialize jumpscare audio from data URL (replace placeholder above)
      try {
        if (jumpscareDataUrl && jumpscareDataUrl.startsWith('data:')) {
          jumpscareAudio = new Audio(jumpscareDataUrl);
          jumpscareAudio.preload = 'auto';
          jumpscareAudio.volume = 1.0;
        }
      } catch (e) {
        console.warn('Failed to init jumpscare audio from data URL:', e);
        jumpscareAudio = null;
      }

      // Score text - add this back before coins setup
      scoreText = this.add.text(16, 16, "score: 0", {
        fontSize: "32px",
        fill: "#fff",
      });

      // Coins setup
      const coins = this.physics.add.group({
        key: "coin",
        repeat: 10,
        setXY: { x: 12, y: 0, stepX: 70 },
      });

      coins.children.iterate((child) => {
        child.setBounceY(Phaser.Math.FloatBetween(0.4, 0.8));
      });

      this.physics.add.collider(coins, platforms);
      this.physics.add.overlap(player, coins, collectCoin, null, this);

      // Initialize audio with data URLs
      try {
        // Replace these URLs with your converted data URLs
        const pipeDataUrl = "data:audio/mpeg;base64,";
        const oofDataUrl = "data:audio/mpeg;base64,";
        
        pipeAudio = new Audio(pipeDataUrl);
        pipeAudio.volume = 1.0;
        
        oofAudio = new Audio(oofDataUrl);
        oofAudio.volume = 1.0;
        
        console.log('Audio elements created');
      } catch (e) {
        console.error('Audio init failed:', e);
      }

      // ...rest of create code...
    }

    function collectCoin(playerObj, coin) {
      // Disable the coin first
      coin.disableBody(true, true);

      // Update score
      score += Phaser.Math.Between(6, 7);
      if (score > 67) score = 67;
      scoreText.setText("score: " + score);

      // trigger jumpscare when reaching exactly 67
      if (score === 67) {
        showJumpscareOverlay();
      }

      // Only modify player physics if needed to restore movement
      if (!stuck && playerObj.body && !playerObj.body.moves) {
        playerObj.body.moves = true;
        playerObj.body.allowGravity = true;
      }
    }

    function clearOverlay() {
      if (!overlayContainer) return;
      overlayContainer.innerHTML = "";
      currentOverlay = null;

      // Stop any sound
      try {
        if (oofAudio && !oofAudio.paused) { oofAudio.pause(); oofAudio.currentTime = 0; }
      } catch(e) {}
      try {
        if (jumpscareAudio && !jumpscareAudio.paused) { jumpscareAudio.pause(); jumpscareAudio.currentTime = 0; }
      } catch(e) {}

      // Re-enable player movement if not stuck
      if (player && player.body && !stuck) {
        player.body.allowGravity = true;
        player.body.moves = true;
        player.clearTint();
      }
    }

    // jumpscare overlay: GIF + data-URL audio
    function showJumpscareOverlay() {
      clearOverlay();
      if (!overlayContainer) return;
      // GIF (replace with any GIF URL you prefer)
      const img = document.createElement("img");
      img.src = "data:image/gif;base64,";
      img.style.maxWidth = "80%";
      img.style.maxHeight = "80%";
      img.style.pointerEvents = "auto";
      img.addEventListener("click", () => clearOverlay());
      overlayContainer.appendChild(img);
      overlayContainer.style.pointerEvents = "auto";
      currentOverlay = "jumpscare";

      // Freeze the player
      if (player && player.body) {
        player.body.allowGravity = false;
        player.body.moves = false;
        player.setVelocity(0, 0);
        player.setTint(0xff0000);
      }

      // Play jumpscare audio (data URL)
      try {
        if (jumpscareAudio) {
          jumpscareAudio.currentTime = 0;
          jumpscareAudio.play().catch((e) => console.warn('jumpscare audio play failed:', e));
        }
      } catch (e) {
        console.warn('Failed to play jumpscare audio:', e);
      }
    }

    // new: show explosion GIF overlay for key 6
    function showExplosionOverlay() {
      clearOverlay();
      if (!overlayContainer) return;
      const img = document.createElement("img");
      img.src = "https://c.tenor.com/XcoJcX1mvpgAAAAC/roblox-funny.gif";
      img.style.maxWidth = "80%";
      img.style.maxHeight = "80%";
      img.style.pointerEvents = "auto";

      // clicking the image will clear the overlay and restore player
      img.addEventListener("click", () => {
        clearOverlay.call(this);
      });

      // append immediately so it becomes visible right away
      overlayContainer.appendChild(img);
      overlayContainer.style.pointerEvents = "auto";
      currentOverlay = "six";
      // Freeze the player
      if (player && player.body) {
        player.body.allowGravity = false;
        player.body.moves = false;
        player.setVelocity(0, 0);
        player.setTint(0xff0000);
      }

      // Play the loaded sound via the scene to ensure playback
      playOofSound(this);
    }

    // new: show rickroll overlay (YouTube embed) for key 7
    function showRickRollOverlay() {
      clearOverlay();
      if (!overlayContainer) return;
      const iframeWrap = document.createElement("div");
      iframeWrap.style.width = "80%";
      iframeWrap.style.height = "60%";
      iframeWrap.style.pointerEvents = "auto";
      const iframe = document.createElement("iframe");
      iframe.width = "100%";
      iframe.height = "100%";
      iframe.src = "https://www.youtube.com/embed/dQw4w9WgXcQ?autoplay=1&rel=0";
      iframe.allow = "autoplay; encrypted-media";
      iframe.style.border = "none";
      iframeWrap.appendChild(iframe);
      overlayContainer.appendChild(iframeWrap);
      overlayContainer.style.pointerEvents = "auto";
      currentOverlay = "seven";
    }

    // new: show WASD video overlay
    function showWASDOverlay() {
      clearOverlay();
      if (!overlayContainer) return;
      const iframeWrap = document.createElement("div");
      iframeWrap.style.width = "80%";
      iframeWrap.style.height = "60%";
      iframeWrap.style.pointerEvents = "auto";
      const iframe = document.createElement("iframe");
      iframe.width = "100%";
      iframe.height = "100%";
      iframe.src = "https://www.youtube.com/embed/eEzjyO-4jBg?autoplay=1&rel=0";
      iframe.allow = "autoplay; encrypted-media";
      iframe.style.border = "none";
      iframeWrap.appendChild(iframe);
      overlayContainer.appendChild(iframeWrap);
      overlayContainer.style.pointerEvents = "auto";
      currentOverlay = "wasd";
    }

    function update() {
      if (!player || !player.body) return;

      // Check for landing with HTML5 Audio
      if (player.body.touching.down && !lastGroundContact && !stuck) {
        if (pipeAudio) {
          pipeAudio.currentTime = 0;  // Reset audio position
          pipeAudio.play().catch(e => console.warn('Pipe audio play failed:', e));
        }
      }
      lastGroundContact = player.body.touching.down;

      // While stuck, disable normal movement/jump
      if (!stuck) {
        if (cursors.left.isDown) player.setVelocityX(-160);
        else if (cursors.right.isDown) player.setVelocityX(160);
        else player.setVelocityX(0);

        if (cursors.up.isDown && player.body.touching.down)
          player.setVelocityY(-330);
      } else {
        // freeze velocities while stuck
        player.setVelocityX(0);
        player.setVelocityY(0);
      }

      // Toggle stuck on JUST-pressed down key
      if (Phaser.Input.Keyboard.JustDown(cursors.down)) {
        if (!stuck && player.body.touching.down) {
          // become stuck
          stuck = true;
          player.body.allowGravity = false;
          player.body.moves = false;
          player.y += 12; // sink into platform for troll effect
          player.setTint(0xff0000);
        } else if (stuck) {
          // unstick on next down-press
          stuck = false;
          player.body.allowGravity = true;
          player.body.moves = true;
          player.y -= 12; // try to lift back roughly to original position
          player.clearTint();
        }
      }

      // Add back key 7 handler
      if (Phaser.Input.Keyboard.JustDown(keySeven)) {
        if (currentOverlay === 'seven') {
          clearOverlay();
        } else {
          showRickRollOverlay();
        }
      }

      // Check for WASD keys
      if (Phaser.Input.Keyboard.JustDown(keyW) || 
          Phaser.Input.Keyboard.JustDown(keyA) || 
          Phaser.Input.Keyboard.JustDown(keyS) || 
          Phaser.Input.Keyboard.JustDown(keyD)) {
        if (currentOverlay === 'wasd') {
          clearOverlay();
        } else {
          showWASDOverlay();
        }
      }

      // Random glitch: flip gravity slightly
      if (Phaser.Math.Between(0, 1000) < 3) {
        this.physics.world.gravity.y = Phaser.Math.Between(100, 600);
      }
    }

    // ensure overlay is removed when game is destroyed
    const originalDestroy = game.destroy;
    game.destroy = function () {
      try {
        // remove window listener
        try { if (windowKeyHandler) window.removeEventListener('keydown', windowKeyHandler); } catch (e) {}
        clearOverlay();
        if (overlayContainer && overlayContainer.parentElement) overlayContainer.parentElement.removeChild(overlayContainer);
        if (debugDiv && debugDiv.parentElement) debugDiv.parentElement.removeChild(debugDiv);
      } catch (e) {}
      originalDestroy.apply(game, arguments);
    };

     return () => game.destroy(true);
   }, []);

   return <div id="phaser-container" />;
 };

 export default PhaserGame;
